# diff.json is generated by elf_diff: python3 -m elf_diff --json_file diff.json cjxl-base cjxl-fno-strict-aliasing

jq ".document.symbols.persisting[]" diff.json | jq -s '. | sort_by(.persisting_symbol.related_symbols.size_delta) | map(select(.persisting_symbol.related_symbols.size_delta != 0) | .persisting_symbol.related_symbols.new_symbol.name_mangled) | .[]'
